import { InputGroup, InputGroupText, Input } from "reactstrap";

function Settings({triggers, index}) {
    return (
        <>
            <h3>Settings</h3>
            <p>Eye Accom: {triggers[index].Breadcrumbs[0]?.EyeAccommodation}</p>
            <p>Raycast: {triggers[index].Breadcrumbs[0]?.UseRaycast}</p>
            <p>Radius: {triggers[index].Breadcrumbs[0]?.Radius}</p>
        </>
    );
}

export default Settings;
